Tomorrow is the night! ✨ Fierce Fashionistas at Munson. A one night only cocktail party at the museum, community fashion show, acro yoga, dance and contortion performances, celebrating women in sports and fitness, athletic wear, and all bodies ✨🙌🤸🏼‍♂️

All the hard work, sweat and tears of trying to rehearse/train and get back to performing shape, with a toddler yelling at me in 100ish days after 4 years of not performing. Let’s do this 🔥💥

